INSERT INTO `real_estates` VALUES (132,'Dự án Vinhomes Ocean Park Gia Lâm',150,'Bán','Hướng Tây',_binary '\0','Trung tâm','Do nhu cầu chuyển đổi dòng tiền chủ nhà gửi bán biệt thự song lập khu San Hô chỉ vài bước chân ra công viên Ngọc Trai, hồ điều hòa 24,5ha và nướng BBQ, cách bể bơi ngoài trời, sân thể thao 100m tại Vinhomes Ocean Park 1 Gia Lâm.',28000000000,'Mới xây','Nhà ở',9,'018','01','571','MBDS-3328','Chủ nhà cần bán nhanh song lập San Hô 150m2, đường thông giá 28 tỷ bao phí',_binary '\0'),(133,'Dự án Vinhomes Ocean Park Gia Lâm',150,'Bán','Hướng Đông Nam',_binary '\0','Trung tâm','Chính chủ cần bán song lập vị trí rất đẹp và thoáng, vài bước chân ra tới hồ, Vincom.\nHướng: Đông Nam.\nXây 3,5 tầng.\nVị trí đẹp đường thông không cụt không phải quay xe.\nGần bể bơi, công viên nội khu, gần shophouse quán xá đông vui, ăn uống tiện lợi, cách hồ lớn vài bước chân.\nCăn song lập rộng, lắp thang máy thoải mái. Chia phòng rất đẹp thoáng.',20000000000,'Mới xây','Nhà ở',9,'018','01','571','MBDS-3042','Gia đình tôi cần bán song lập 150m2, Đông Nam gần hồ giá rẻ nhất dự án 20 tỷ sổ đỏ vĩnh viễn',_binary '\0'),(134,'Đường Xô Viết Nghệ Tĩnh',150,'Bán','Hướng Bắc',_binary '\0','Trung tâm','Siêu phẩm xây mới - ô tô ngủ trong nhà trung tâm Bình Thạnh.\nVị trí hẻm trước nhà 6m ô tô vivu, cách mặt tiền 50m, qua Quận 1 đúng 1 cây cầu Thị Nghè. Bán kính 1km full tiện ích ko thiếu thứ gì.',7290000000,'Đã qua sử dụng','Nhà ở',9,'765','79','26953','MBDS-4148','Bán nhà xây mới chính chủ - hẻm xe hơi - Bình Thạnh giáp Quận 1 - 4 tầng lầu',_binary '\0'),(135,'Đường Đinh Bộ Lĩnh',133.4,'Bán','Hướng Tây Bắc',_binary '\0','Trung tâm','+ Vị trí khu đất gần trung tâm - khu vực xung quanh gần chợ, trường học,... Qua Quận 1, Phú Nhuận, Quận 3 chỉ tầm 10 phút.\n+ Nhà kiên cố, chắc chắn với kết cấu: 1 trệt 2 tầng, 5 phòng ngủ, 4 nhà vệ sinh, phòng khách và sân để xe cực rộng. Có Phòng ngủ trệt cho người lớn tuổi.\n+ Sổ hồng vuông đẹp - hoàn công đầy đủ.',19500000000,'Có sẵn','Nhà ở',10,'765','79','26914','MBDS-3329','Bán biệt thự mini Đường Đinh Bộ Lĩnh - Đường rộng 7.5m!',_binary '\0'),(136,'Đường Hải Phòng',87.4,'Bán','Hướng Bắc',_binary '\0','Trung tâm','+ Vị trí quyền lực, kinh doanh sầm uất đắt đỏ, đẳng cấp trung tâm của trung tâm Đà Nẵng. Thuộc trung tâm Hải Châu 1, cách bệnh viện Đa Khoa Đà Nẵng chỉ 300 mét. Khu dân cư văn minh, đặc biệt cao ráo không ngập nước.\n+ Bán đất tặng nhà 3 tầng, chủ xây tâm huyết, sổ sách pháp lý hoàn chỉnh.\n+ Diện tích đất lớn gần 90m², vuông vắn. Đặc biệt có một mặt kiệt (hẻm) phía sau dùng riêng cho nhà, có thể tận dụng làm lối đi riêng để phân công năng vừa ở + vừa kinh doanh.\n+ Giá tốt nhất thị trường, chỉ 140 triệu/m², thấp hơn 30% giá khu vực.',12500000000,'Đã qua sử dụng','Nhà ở',10,'492','48','20236','MBDS-8469','Bán đất tặng nhà 3 tầng phố Hải Phòng - trung tâm Đà Nẵng - kinh doanh sầm uất - vị trí quyền lực',_binary '\0'),(137,'Đường Mai Chí Thọ',100,'Bán','Hướng Đông Nam',_binary '\0','Ngoại ô','Cần sang nhượng toà nhà 5 tầng xây tâm huyết MT Mai Chí Thọ, Hoà Xuân, Cẩm Lệ.\n- DT 5 x 20 = 100m².\n- Vị trí đắc địa, dân cư đông đúc. Thuận tiện vừa ở vừa kinh doanh. Thang máy xịn thông các sàn. Đường 10,5m lề 5m.\n+ T1,2: Mặt bằng trống rộng rãi. Có thể cho thuê mặt bằng mở siêu thị, spa, văn phòng cty...\n- Nội thất nhập khẩu cao cấp.\n- Vị trí đắc địa, đầy đủ tiện ích, DVTM bao quanh.\n- Hướng Đông Nam.',5000000000,'Mới xây','Nhà ở',11,'495','48','20314','MBDS-4497','Bán nhà MT Mai Chí Thọ, Vị trí đắc địa, đầy đủ tiện ích, DVTM bao quanh.',_binary '\0'),(138,'Đường Lê Đình Lý',42,'Bán','Hướng Đông Nam',_binary '\0','Trung tâm','Bán nhà 4 tầng kiệt oto Lê Đình Lý - Cách đường chỉ 15m. Gần Cầu Rồng chỉ 3 phút đi xe\n- Dt đất: 42m² ngang 4m vuông vức\n- Công năng: 3p ngủ, 3wc,2 sân thượng trước sau ngắm view tp .\n- full nội thất đầy đủ chỉ kéo vali vào ở.\nGiá 4tỷ070 ( thương lượng )',4070000000,'Đang cải tạo','Nhà ở',11,'491','48','20218','MBDS-9117','NHÀ ĐẸP 4 TẦNG KIỆT OTO LÊ ĐÌNH LÝ - CÁCH CẦU RỒNG CHỈ 3 PHÚT ĐI XE',_binary '\0'),(139,'Dự án KĐT Phú Mỹ An Huế, Đường Tố Hữu',72,'Bán','Hướng Bắc',_binary '\0','Ngoại ô','+ Vị trí mặt tiền đường Tố Hữu rộng 60m, trục đường nối thẳng về sân bay Phú Bài. Đối diện là khu Hành chính tập trung tỉnh và quảng trường nhạc nước, xung quanh nhiều dự án lớn gần Aeon Mall Huế, KĐT Phú Mỹ An, Phú Xuân City...\n+ 800m đến trung tâm thương mại Aeon Mall Huế, cho thuê 25 triệu/tháng.\n+ Shophouse 4 tầng đầy đủ công năng, có sẵn ô chờ thang máy, sử dụng các tiện ích Free: Hồ bơi, phòng tập gym.',8700000000,'Có sẵn','Nhà ở',13,'474','46','19815','MBDS-7670','Shophouse 4 tầng mặt tiền Tố Hữu, đối diện quảng trường TT hành chính tỉnh, 800m đến Aeon Mall Huế',_binary '\0'),(140,'Đường Lương Thế Vinh',200,'Bán','Hướng Tây Bắc',_binary '\0','Ngoại ô','Bán lô đất đẹp nhất nhì TP Tam Kỳ, Quảng Nam.\nMời quý anh chị tham khảo và cảm nhận!\n\nNằm ngay vị trí đắc địa bậc nhất khu nhà giàu TP Tam Kỳ, Quảng Nam.\nVị trí: Ngay cổng Khách sạn & Resort Bàn Thạch.\n(01 Lương Thế Vinh, Tam Kỳ, Quảng Nam).',4200000000,'Có sẵn','Đất',13,'502','49','20341','MBDS-3000','Bán lô đất đẹp nhất nhì TP Tam Kỳ, Quảng Nam. Mời quý anh chị tham khảo và cảm nhận',_binary '\0');
